	(6,4,1,NULL,'sonata.block.service.text','{\"content\":\"        <a href=\\\"http:\\/\\/www.sonata-project.org\\\">Sonata Project<\\/a> sandbox demonstration.\\n\\n<script type=\\\"text\\/javascript\\\">\\n\\n  var _gaq = _gaq || [];\\n  _gaq.push([\'_setAccount\', \'UA-25614705-2\']);\\n  _gaq.push([\'_trackPageview\']);\\n\\n  (function() {\\n    var ga = document.createElement(\'script\'); ga.type = \'text\\/javascript\'; ga.async = true;\\n    ga.src = (\'https:\' == document.location.protocol ? \'https:\\/\\/ssl\' : \'http:\\/\\/www\') + \'.google-analytics.com\\/ga.js\';\\n    var s = document.getElementsByTagName(\'script\')[0]; s.parentNode.insertBefore(ga, s);\\n  })();\\n\\n<\\/script>\"}',1,1,'2013-02-19 06:29:08','2013-02-19 06:29:08'),
